import React from "react";
import _ from "lodash";
import { Grid, Button, Typography, Hidden } from "@material-ui/core";
import { 
  qualityTitle,
  extraQualityTitle,
  toturialTitle,
  toturialContent,
  toolTitle,
  toolContent,
  warrantTitle,
  warrantContent,
  integratedTitle,
  integratedContent,
  integratedContentone,
  integratedContentTwo,
  postEasyTitle,
  postEasyContent,
  controlTitle,
  controlContent,
  priceListTitle,
  priceListContent,

} from "./Constants"
const xx = require("../../assets/images/post-icon-01.svg")
import  "../../assets/images/post-icon-02.svg"
import  "../../assets/images/post-icon-03.svg"
import  "../../assets/images/post-icon-04.svg"
import  "../../assets/images/post-icon-05.svg"
import  "../../assets/images/post-icon-06.svg"

const Benefit = () => {
  return (
    <div className={"mission-area body-general"} style={{ textAlign: 'center' }} >
      <Typography variant="h4" style={{ fontWeight: 700 }} >
        {qualityTitle}
      </Typography>
      <Typography style={{ fontWeight: 500 }} >
        {extraQualityTitle}
      </Typography>
      {xx}
    </div>    
  );
};

export default Benefit;
